import React from 'react';
import { Form, Icon, Input, Button, Checkbox } from 'antd';

const Loans = () => {
    const onSubmit = () => {};

    const onChangeName = () => {};

    const onChangePhone01 = () => {};

    const onChangePhone02 = () => {};

    const onChangePhone03 = () => {};

    const onChangeTerm01 = () => {};
    
    const onChangeTerm02 = () => {};

    const term01 = true;
    const term02 = true;
    return (
        <>
            <Form layout="inline" onSubmit={onSubmit} style={{backgroundColor: 'red', flexDirection: 'row'}}>
                <div>
                    <label htmlFor="user-name"></label>
                    <Input name="user-name" required onChange={onChangeName} style={{width: 100, flex:1}} placeholder="이름"></Input>
                </div>
                <div>
                    <label htmlFor="user-phone01"></label>
                    <Input name="user-phone01" required onChange={onChangePhone01} style={{width: 100, flex:1}} placeholder="010" ></Input>
                </div>
                <div>
                    <label htmlFor="user-phone02"></label>
                    <Input name="user-phone02" required onChange={onChangePhone02} style={{width: 100, flex:1}} placeholder="1234"></Input>
                </div>
                <div>
                    <label htmlFor="user-phone03"></label>
                    <Input name="user-phone03" required onChange={onChangePhone03} style={{width: 100, flex:1}} placeholder="5678"></Input>
                </div>
                <div>
                    <Button type="primary" htmlType="submit">빠른 상담신청하기</Button>
                </div>
            </Form>
        </>
    )
}

export default Loans;
